import React from 'react';
import './WhoWeHelp.css';
import FrameLayout from '../../frame_layout/FrameLayout';

function WhoWeHelp() {
  return (
      <FrameLayout>
         <h1>
         Who We Help
         </h1>
      </FrameLayout>
  );
}

export default WhoWeHelp;
